

create database govdb;
USE govdb;

CREATE TABLE `government_table` (
  `user_ID` VARCHAR(14) NOT NULL,  -- 아이디(ID)
  PRIMARY KEY (`user_ID`)
);


CREATE TABLE `public_table` (
`name` VARCHAR(3) NOT NULL,  -- 이름
`sex` VARCHAR(1) NOT NULL,  -- 성별
`age` INT NOT NULL,  -- 나이
`pid` VARCHAR(14) NOT NULL,  -- 주민번호
`address` VARCHAR(10) NOT NULL,  -- 주소
`mobile` VARCHAR(11) NOT NULL,  -- 전화번호
  PRIMARY KEY (`pid`),
  FOREIGN KEY(pid) REFERENCES government_table(user_ID)
);



CREATE TABLE `hospital_table` (
  `hospital_name` VARCHAR(5) NOT NULL,  -- 병원명
  `business_num` VARCHAR(10) NOT NULL,  -- 사업자번호
  PRIMARY KEY (`hospital_name`),
  FOREIGN KEY(business_num) REFERENCES government_table(user_ID)
);


CREATE TABLE `company_table` (
  `company_name` VARCHAR(3) NOT NULL,  -- 제약사명
  `business_num` VARCHAR(10) NOT NULL,  -- 사업자번호
  `vaccine_inventory` INT NOT NULL,  -- 재고량
  `vaccine_production` INT NOT NULL,  -- 생산량
  PRIMARY KEY (`company_name`),
  FOREIGN KEY(business_num) REFERENCES government_table(user_ID)
  );
  

CREATE TABLE `vaccine_table` (
  `vaccine_own_num` VARCHAR(10) NOT NULL,  -- 백신고유번호
  `production_date` DATE NOT NULL,  -- 생산일자
  `expiration_date` DATE NOT NULL,  -- 유통기한
  `company_name` VARCHAR(10) NOT NULL,  -- 제약사명
  `own_name` VARCHAR(5) NOT NULL,  -- 소유기관명
  `use` VARCHAR(2) NOT NULL, -- 사용여부
  PRIMARY KEY (`vaccine_own_num`),
  FOREIGN KEY(company_name) REFERENCES company_table(company_name)
  );
  













CREATE TABLE `purchase_table` (
  `order_num` INT AUTO_INCREMENT,  -- 주문순서
  `trade_type` VARCHAR(10) NOT NULL,  -- 거래종류
  `amount` INT NOT NULL,  -- 수량
  `order_date` DATE NOT NULL,  -- 주문날짜
  `order_institution` VARCHAR(10) NOT NULL,  -- 발주 기관명
  `supply_institution` VARCHAR(10) NOT NULL,  -- 납품 기관명
  PRIMARY KEY (`order_num`),
  FOREIGN KEY(supply_institution) REFERENCES company_table(company_name),
  FOREIGN KEY(order_institution) REFERENCES hospital_table(hospital_name)
  );
  

CREATE TABLE `COVID19_table` (
  `insert_order` INT AUTO_INCREMENT,  -- 입력순서
  `sum_firstvaccination` INT NOT NULL,  -- 1차 접종자 수
  `sum_second_vaccination` INT NOT NULL,  -- 2차 접종자 수
  `total_diagnosis` DATE NOT NULL,  -- 확진자 수
  `total_death` INT NOT NULL,  -- 사망자 수
  `business_num` VARCHAR(10) NOT NULL,  -- 사업자 번호
  PRIMARY KEY (`insert_order`),
  FOREIGN KEY(business_num) REFERENCES government_table(user_ID)
  );


CREATE TABLE `patient_table` (
  `patient_num` INT AUTO_INCREMENT,  -- 환지번호
  `patient_name` VARCHAR(3) NOT NULL,  -- 환자 이름
  `pid` VARCHAR(14) NOT NULL,  -- 주민번호
  `hospital_name` VARCHAR(5) NOT NULL, -- 병원 이름
  `check_date` DATE NULL, -- 검사일
  `COVID19_test_result` VARCHAR(2) NOT NULL,  -- 코로나 확진여부
  `COVID19_diagnosis` DATE NULL,  -- 확진일
  `hospitalization_date` DATE NULL,  -- 입원일
  `discharge_date` DATE NULL,  -- 퇴원일
  `death_date` DATE NULL,  -- 사망일
  `inoculation` INT NOT NULL,  -- 접종여부
  `vaccination_date` DATE NOT NULL,  -- 접종날짜
  `vaccine_num` VARCHAR(10) NULL,  -- 접종한 백신 고유번호
  `breakthrough_infection` VARCHAR(1) NOT NULL, -- 돌파감염여부
  PRIMARY KEY (`patient_num`),
  FOREIGN KEY(hospital_name) REFERENCES hospital_table(hospital_name),
  FOREIGN KEY(pid) REFERENCES public_table(pid)
  );


